port: 7890
socks-port: 7891
allow-lan: false
mode: Rule
log-level: info
external-controller: 127.0.0.1:9090
experimental:
  ignore-resolve-fail: true
dns:
  enable: true
  ipv6: false
  listen: 0.0.0.0:53
  default-nameserver: 
    - 119.29.29.29
    - 223.5.5.5
    - 1.1.1.1
    - 8.8.8.8
  enhanced-mode: redir-host
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter:  
    - '*.lan'
    - localhost.ptlogin2.qq.com
  nameserver:
    - 119.29.29.29
    - 223.5.5.5
  fallback:
    - 1.1.1.1
    - 8.8.8.8
  fallback-filter:
    geoip: true 
    ipcidr:
    - 240.0.0.0/4
Proxy:
  - name: "1"
    type: ss
    server: 0.0.0.0
    port: 
    cipher: chacha20-ietf-poly1305
    password: 000
    udp: true
    obfs: tls
    obfs-host: 0.0.0.0
Proxy Group:
  - name: "富强"
    type: select
    proxies:
      - 法治
      - 爱国
      - 敬业
      - 诚信
      - 友善
      - DIRECT
  - name: "民主"
    type: select
    proxies:
      - DIRECT
      - 富强
  - name: "文明"
    type: select
    proxies:
      - REJECT
      - 富强
      - 民主
