    type: select
    proxies:
      - 民主
      - 富强
      - 法治
      - 爱国
      - 敬业
      - 诚信
      - 友善
  - name: "自由"
    type: select
    proxies:
      - 富强
      - 民主
      - 法治
      - 爱国
      - 敬业
      - 诚信
      - 友善
  - name: "平等"
    type: select
    proxies:
      - 民主
      - 富强
      - 法治
      - 爱国
      - 敬业
      - 诚信
      - 友善
  - name: "公正"
    type: select
    proxies:
      - 民主
      - 富强
      - 法治
      - 爱国
      - 敬业
      - 诚信
      - 友善
  - name: "法治"
    type: select
    proxies:
      - 1
  - name: "爱国"
    type: select
    proxies:
      - 1
  - name: "敬业"
    type: select
    proxies:
      - 1
  - name: "诚信"
    type: select
    proxies:
      - 1
  - name: "友善"
